import React from 'react';
import TodoListItem from './TodoListItem.js';

const TodoList = ({data}) =>
{
	const elements = data.map((item) => {
		return(
			<li key={item.id}>
				<TodoListItem label={item.label} important={item.important}/>
			</li>
		);
	});

	return(
		<ul>
			{elements}
		</ul>
	);
};

export default TodoList;
